import React from 'react'
import Sketch from "react-p5";

export default function MySketch(props) {

  const setup = p5 => {
    p5.createCanvas(500, 500)
  }

  const draw = p5 => {
    p5.loadImage(props.image, img => {
      p5.image(img, 0, 0)
    })
  }

  return <Sketch setup={setup} draw={draw} />
}
